import React, {useState} from 'react';
import Header from "../../helpers/headers/Headers";
import TitleAndServices from "../../helpers/TitleAndServices";
import Calculation from "./Calculation";
import Paginate from "../../helpers/scroll/Paginate";
import {DataStoreSites} from "../portfolio/store/DataStoreSites";
import {DataStoreSmm} from "../portfolio/store/DataStoreSMM";
import {DataStoreApp} from "../portfolio/store/DataStoreApp";
import {DataStoreDesign} from "../portfolio/store/DataStoreDesign";
import {StorePriceSite} from "./store/StorePriceSite";
import {StorePriceSMM} from "./store/StorePriceSMM";
import {StorePriceApp} from "./store/StorePriceApp";
import {StorePriceDesign} from "./store/StorePriceDesign";
import {HandleChoices} from "./choices/HandleChoices";

function Prices(props) {

    const handleChoices = new HandleChoices(useState(0));
    return (
        <>

            <div className="body global-margin">
                <TitleAndServices paginate={handleChoices.paginate} title="Вычеслить цену"/>
                <div style={{
                    marginTop: "2rem"
                }}/>
                <Calculation handleChoices={handleChoices}/>
            </div>
        </>

    );
}

export default Prices;
